import React from 'react'
import { useNavigate } from 'react-router-dom'

const Navbar = (props) => {
    const navigate = useNavigate()
    const toLogin = () => {
        navigate('/login')
    }
    const toSignup =()=>{
        navigate('/signup')
    }
    const toHome=()=>{
        navigate('/')
    }
    return (
        <div className='flex justify-center'>
            <div className='flex justify-between px-6 w-full'>
                <label onClick={toHome} className='font-bold cursor-pointer m-1 text-lg'>{props.logo}</label>
                {/* <span>{props.logo}</span> */}
                <div>
                    <label className='mx-1' htmlFor="">Home</label>
                    <label className='mx-1' htmlFor="">About</label>
                    <label className='mx-1' htmlFor="">Pricing</label>
                    <label className='mx-1' htmlFor="">Contacts</label>
                    <label className='mx-1' htmlFor="">Events</label>
                </div>
                {props.loginpage ?
                    <button onClick={toSignup} className='px-2 m-1 rounded-lg text-white hover:bg-blue-500 bg-sky-500'>SignUp</button>

                    :

                    <button onClick={toLogin} className='px-2 m-1 rounded-lg text-white hover:bg-blue-500 bg-sky-400'>Login</button>
                }
            </div>

        </div>
    )
}

export default Navbar
